    var myHeaders = new Headers();
    myHeaders.append("Access-Control-Allow-Origin", "*");
    myHeaders.append("Content-Type", "application/json");

  const insertNurse=(nurse_cred)=>{
    console.log(nurse_cred,JSON.stringify( nurse_cred ))
    var requestOptions = {
        method: 'POST',
        headers: myHeaders,
        mode: 'cors',
        redirect: 'follow',
        body: JSON.stringify( nurse_cred )  
      };

      fetch("http://localhost:3000/insertNurse", requestOptions)
      .then(response => response.json())
      .then(result => {console.log(result)
    })
      .catch(error => console.log('error', error));
  }

    const handleSubmit = (event) => {
        insertTimeSlot
        var time_date={}
        var time_slot={"date":"", "start_time":"","end_time":"","max_capacity":100}

        event.preventDefault();
